const RecipeDetails = ({recipe, close}) => {
    const recipeItems = recipe.recipe
    console.log(recipeItems)

    return(
      <>
          <h2 onClick={close}>{recipe.name}</h2>
          {recipeItems.map((item,index)=>(
              <h3 key={index}>{recipeItems[Object.keys(recipeItems)[index]]}</h3>
          ))}
      </>

  )
}

export {RecipeDetails}
